import { ListGroup } from "react-bootstrap";
import Todo from './Todo'

export default function TodoList({ todos, checkTodo }) {
  return (
    <ListGroup className="todo-list w-100">
      {todos.map((todo) => <Todo todo={todo} checkTodo={checkTodo} />)}
    </ListGroup>
  );
}
